<p><br></p><p style="font-family: Ubuntu Condensed, Noto Sans Korean; font-size: 15px; background-color: rgb(255, 255, 255);">지역별 TC 정보입니다.</p><p style="font-family: Ubuntu Condensed, Noto Sans Korean; font-size: 15px; background-color: rgb(255, 255, 255);">지역 이름 옆 사각형으로 표시된 것은 웨이포인트가 있는 지역이라는 뜻입니다.</p><p style="font-family: Ubuntu Condensed, Noto Sans Korean; font-size: 15px; background-color: rgb(255, 255, 255);">&nbsp;</p><p style="font-family: Ubuntu Condensed, Noto Sans Korean; font-size: 15px; background-color: rgb(255, 255, 255);"><b>TC란?</b></p><p style="font-family: Ubuntu Condensed, Noto Sans Korean; font-size: 15px; background-color: rgb(255, 255, 255);">Treasure&nbsp;Class의 준말로 해당 던전에서 드랍되는 아이템의 레벨을 의미합니다.</p><p style="font-family: Ubuntu Condensed, Noto Sans Korean; font-size: 15px; background-color: rgb(255, 255, 255);">TC가 높을수록 높은 등급의 아이템이 나올 수 있으며, 85 이상의 던전에서는 조합 아이템, 퀘스트 아이템을 제외한 모든 아이템이 다 드랍될 수 있습니다.</p><p><br></p><p><img src="data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAA2QAAA3HCAYAAAAXX/HVAAAgAElEQVR4Aex9Z7guRZnt/nvvPHeuepEMhyhjOmNE3SpHRxkV0wxjxHFMuM1hQDGM6DjKDDLK7AOHA4ckoBzgkBR1iwiSDUgwgCIbUBRJSlBU4ATe+6zqfrurq6uq4xf3+p5n7/6+7gpvrXq7e61+q6pnhB8iQASIABEgAkSACBABIkAEiAARGAkCMyOplZUSASJABIgAESACRIAIEAEiQASIgFCQ0QmIABEgAkSACBABIkAEiAARIAIjQoCCbETAs1oiQASIABEgAkSACBABIkAEiAAFGX2ACBABIkAEiAARIAJEgAgQASIwIgQoyEYEPKslAkSACBABIkAEiAARIAJEgAhQkNEHiAARIAJEgAgQASJABIgAESACI0KAgmxEwLNaIkAEiAARIAJEgAgQASJABIgABRl9gAgQASJABIgAESACRIAIEAEiMCIEKMhGBDyrJQJEgAgQASJABIgAESACRIAIUJDRB4gAESACRIAIEAEiQASIABEgAiNCgIJsRMCzWiJABIgAESACRIAIEAEiQASIAAUZfYAIEAEiQASIABEgAkSACBABIjAiBCjIRgQ8qyUCRIAIEAEiQASIABEgAkSACFCQ0QeIABEgAkSACBABIkAEiAARIAIjQoCCbETAs1oiQASIABEgAkSACBABIkAEiAAFGX2ACBABIkAEiAARIAJEgAgQASIwIgQoyEYEPKslAkSACBABIkAEiAARIAJEgAhQkNEHiAARIAJEgAgQASJABIgAESACI0KAgmxEwLNaIkAEiAARIAJEgAgQASJABIgABRl9gAgQASJABIgAESACRIAIEAEiMCIEKMhGBDyrJQJEgAgQASJABIgAESACRIAIUJDRB4gAESACRIAIEAEiQASIABEgAiNCgIJsRMCzWiJABIgAESACRIAIEAEiQASIAAUZfYAIEAEiQASIABEgAkSACBABIjAiBCjIRgQ8qy
